import { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import Sidebar from "../components/Sidebar";
import API_BASE_URL from "../config"; // Use a config file for API URL

const Dashboard = () => {
  const [balance, setBalance] = useState(0);
  const [income, setIncome] = useState(1000); // Default income (can be dynamic)
  const [expenses, setExpenses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        setError(null);

        const res = await axios.get(`${API_BASE_URL}/finance/expenses`, {
          headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
        });

        setExpenses(res.data);

        // Calculate total expenses
        const totalExpense = res.data.reduce((sum, exp) => sum + exp.amount, 0);
        setBalance(income - totalExpense);
      } catch (error) {
        setError(error.response?.data?.message || "Failed to fetch data.");
        console.error("Error fetching expenses:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [income]); // Recalculate balance if income changes

  return (
    <div className="flex">
      {/* Sidebar */}
      <Sidebar />

      {/* Main Content */}
      <div className="flex-1 p-6 bg-gray-100 min-h-screen">
        <div className="max-w-4xl mx-auto bg-white p-6 rounded-lg shadow-lg">
          <h1 className="text-2xl font-bold text-center mb-4">Dashboard</h1>

          {/* Display Loading */}
          {loading ? (
            <div className="text-center mt-4">
              <span className="animate-spin h-6 w-6 border-4 border-blue-600 border-t-transparent rounded-full inline-block"></span>
              <p className="mt-2 text-gray-600">Loading...</p>
            </div>
          ) : error ? (
            <div className="text-center mt-4 text-red-500">{error}</div>
          ) : (
            <>
              {/* Balance and Income Section */}
              <div className="mt-4 flex justify-between items-center">
                <div>
                  <h2 className="text-lg font-semibold text-gray-700">Total Income</h2>
                  <p className="text-xl font-bold text-green-600">${income}</p>
                </div>
                <div>
                  <h2 className="text-lg font-semibold text-gray-700">Balance</h2>
                  <p className={`text-xl font-bold ${balance < 0 ? "text-red-600" : "text-green-600"}`}>
                    ${balance}
                  </p>
                </div>
              </div>

              {/* Expenses List */}
              <div className="mt-6">
                <h2 className="text-lg font-semibold text-gray-700">Expenses</h2>
                <ul className="mt-2">
                  {expenses.length === 0 ? (
                    <p className="text-center text-gray-500">No expenses recorded.</p>
                  ) : (
                    expenses.map((expense) => (
                      <li key={expense._id} className="border p-3 mt-2 rounded-md shadow-sm bg-gray-50 flex justify-between">
                        <span className="text-gray-800">{expense.category}</span>
                        <span className="text-gray-600">${expense.amount}</span>
                      </li>
                    ))
                  )}
                </ul>
              </div>
            </>
          )}

          {/* Add Expense Button */}
          <div className="mt-6 text-center">
            <Link
              to="/add-expense"
              className="inline-block px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
            >
              âž• Add Expense
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
